import "./style/SlideShow.css"

import { useState } from "react"

const SlideShow = ({ images }) => {
    const [currSlideIndex, setCurrSlideIndex] = useState(0)

    console.log(currSlideIndex)

    return (
        <div className="slideshow-container">
            <div class="slides fade">
                <img src={images[currSlideIndex].url} />
                <div class="caption">{images[currSlideIndex].caption}</div>
            </div>
            <div class="arrows">
                <a class="prev" onclick={setCurrSlideIndex(currSlideIndex - 1 % images.length)}>&#10094;</a>
                <a class="next" onclick={setCurrSlideIndex(currSlideIndex + 1 % images.length)}>&#10095;</a>
            </div>
        </div>
    )
}

export default SlideShow;
